    line-height: 1.5;
}

.featured-work-container {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    align-items: center;
    gap: 20px;
    margin-bottom: 20px;
}


@media (max-width:900px) {
    body {
        transform-origin: top left; /* Maintain the top-left corner as the scaling origin */

    }
    .hero{
        overflow: hidden;
    }
    .hero-text {
        padding: 20px; /* Maintain consistent padding on mobile */
        margin-top: 0;
    }

    .hero-text .name {
        font-size: 70px;
        padding: 0;
        text-align: center;
    }



    .project-item {
        width: 100%;
        margin-bottom: 50px;
    }
    .projects-title, .projects-description, .projects-tags {
        margin: 10px 50px;
    }
    .projects-image img {
        width: 90%;
        max-width: 700px;

        border-radius: 10px;
        transition: transform .3s ease;
    }
    section {
        display: grid;
        place-items: flex-start;
        align-content: center;
    }

}
